class NeuroGPTExtension {
  constructor() {
    // Info about the extension
    this.extensionId = "Neurogpt";
    this.extensionName = "NeuroGPT";
    this.extensionIcon = "data:image/png;base64,"
    // Initialize the last response as empty string
    this.lastResponse = "";
  }
  getInfo() {
    return {
      // The extension ID
      id: this.extensionId,
      // The extension name
      name: this.extensionName,
    
      // The icon for the extension
      blockIconURI: this.extensionIcon,
      // The color of the blocks in the extension
      color1: '#c4126f',
      
      blocks: [
        // Make the blocks
        {
          opcode: "chatgpt",
          blockType: Scratch.BlockType.REPORTER,
          text: "Send [prompt] to NeuroGPT API Key: [api_key] Model: [model]",
          arguments: {
            prompt: {
              type: Scratch.ArgumentType.STRING,
              defaultValue: "Hello",
            },
            api_key: {
              type: Scratch.ArgumentType.STRING,
              defaultValue: "YOUR_API_KEY",
            },
            model: {
              type: Scratch.ArgumentType.STRING,
              menu: "models",
              defaultValue: "gpt-3.5-turbo-16k",
            },
          },
        }, 
        {
          opcode: "getLastResponse",
          blockType: Scratch.BlockType.REPORTER,
          text: "Last Response",
        },
        {
          blockType: "label",
          text: "Creators:",
        },
        {
          blockType: "label",
          text: "Extension by Rooglex",
        },
        {
          blockType: "label",
          text: "API by NeuroGPT",
        },
        {
          blockType: "label",
          text: "All NeuroGPT models by OpenAI",
        }
      ],
      menus: {
        models: {
          acceptReporters: true,
          items: [
            // List of available models
            { text: "GPT-4", value: "gpt-4" },
            { text: "GPT-4 0314", value: "gpt-4-0314" },
            { text: "GPT-3.5 Turbo 16k (recommended)", value: "gpt-3.5-turbo-16k" },
            { text: "GPT-3.5 Turbo", value: "gpt-3.5-turbo" },
            { text: "GPT-3.5 turbo 0613", value: "gpt-3.5-turbo-0613" },
            { text: "GPT-3.5 turbo 1106", value: "gpt-3.5-turbo-1106" },
            { text: "GPT-3.5 Turbo 16k 0613", value: "gpt-3.5-turbo-16k-0613" },
          ],
        },
      },
    };
  }

  // The actual code
  async chatgpt({ prompt, api_key, model }) {
    // Implement the HTTP request and response processing here.
    const url = "https://neuroapi.host/v1/chat/completions";
    const headers = {
      "Content-Type": "application/json",
      Authorization: `Bearer ${api_key}`,
    };
    const requestBody = {
      model: model,
      messages: [
        {
          role: "user",
          content: prompt,
        },
      ],
      allow_fallback: true,
    };

    const response = await fetch(url, {
      method: "POST",
      headers: headers,
      body: JSON.stringify(requestBody),
    });

    // Manage the API response using JSON
    const responseData = await response.json();
    // Find the content of the message in the response
    const responseContent = responseData.choices[0]?.message?.content || "";
    // Store the response content in the lastResponse property
    this.lastResponse = responseContent;
    // Show the response
    return responseContent;
  }

  getLastResponse() {
    // Return the stored last response content
    return this.lastResponse;
  }
}

// Register the ChatGPT extension
Scratch.extensions.register(new NeuroGPTExtension());
